import os

import math
class Solution(object):
    def numSubarrayProductLessThanK(self, nums, k):
        if not nums:
            return 0
        k = math.log(k) if k > 0 else float('-inf')
        results = 0
        # construct the prefix_product arr
        prefix_pro = [0] * (len(nums)+1)

        for idx,num in enumerate(nums):
            prefix_pro[idx+1] = prefix_pro[idx] +math.log(num)

        # fix the left border, searc for the first impossible right border
        for i in range(len(nums)):
            l,r = i,len(nums)
            while l < r:
                mid = (l+r)//2
                if prefix_pro[mid+1] - prefix_pro[i] <  k:
                    l = mid + 1
                else:
                    r = mid
            if r == i:
                continue
            print(i,r)
            # from i - r-1, the product < k
            results += r - i
            # results += ((r-i)*(r-i+1)//2)
        return results

